class datosParseados:
	def  __init__(self,nombre,valor,segundos):
		self.nombre = nombre
		self.valor = valor
		self.segundos = segundos


def parser(datos):
	lista = datos.split(",")
	listaParseada=[]
	counter = 0
	while counter <lista.length():
		listaParseada.add(datosParseados(lista[counter+0], lista[counter+1], lista[counter+2]))
		counter = counter + 3
	return listaParseada

print(parser(datos))